import React from 'react';
import img1 from '../assets/cube.jpg';
import imgPet from '../assets/Adopt_a_Pet.jpeg';
import imgPaloma from '../assets/Paloma_Odv.jpeg'

export const projectsList = [
  {
    img: imgPet,
    title: "Adopt a Pet",
    type: "REACT"
  },
  {
    img: imgPaloma,
    title: "Paloma Odv",
    type: "HTML - CSS"
  },
  {
    img: img1,
    title: "Portfolio",
    type: "REACT"
  }

]
